import './App.css';

function App() {
  return (
    <div className="grid-container">
      <header className="header">
        <div className="brand">
          <button onclick="openMenu()">
            &#9776;
          </button>
          <a href="index.html">amazona</a>
        </div>
        <div class="header-links">
                <a href="cart.html">Cart</a>
